package com.example.sweater.study;

import java.io.*;
import java.sql.Blob;
import java.util.Base64;

public class Solution {

    public static void main(String[] args)throws Exception {
        Blob image = null;
        //save image into database
        File file = new File("D:\\test2.jpg");
        byte[] bFile = new byte[(int) file.length()];
        try {
            FileInputStream fileInputStream = new FileInputStream(file);
            //convert file into array of bytes
            fileInputStream.read(bFile);
            fileInputStream.close();
        } catch (Exception e) {
            e.printStackTrace();
        }

        byte[] bytes = "Hello, World!".getBytes("UTF-8");

        String encoded = Base64.getEncoder().encodeToString(bFile);
        //encoded = "";
        encoded = "";
        System.out.println(encoded.length());
        byte[] decoded = Base64.getDecoder().decode(encoded);

        System.out.println(decoded.length);
        writeToFile(decoded, "D:\\test2FromByte.jpg" );
    }

    public static void writeToFile(byte[] data, String fileName) throws IOException {
        FileOutputStream out = new FileOutputStream(fileName);
        out.write(data);
        out.close();
    }
}